import { Switch, Route } from "react-router-dom";
import './App.css';
import Container from './components/container/container'
import Header from './components/header/header'
import Main from './components/main/main'

function App() {


  return (
    <>
<Header/>
<Switch>
  <Route path="/" exact>
<Container>
<Main/>
</Container>
</Route>
</Switch>
</>
  );
}




export default App;
